query.sfwSql:
SELECT PA.PERSON_ID AS PERSON_ID, PA.PERSON_ACCOUNT_ID AS PERSON_ACCOUNT_ID, P.LAST_NAME AS LAST_NAME, P.FIRST_NAME AS FIRST_NAME, PL.PLAN_NAME AS PLAN_NAME , CV.[DESCRIPTION] AS PLAN_PARTICIPATION_STATUS, 'Payment election as TFFR check but no Remittance for the month' as ERR_MSG FROM (SELECT PERSON_ACCOUNT_ID FROM SGT_PERSON_ACCOUNT_PAYMENT_ELECTION WHERE PAYMENT_METHOD_VALUE = 'TFPC' AND (ISNULL(IBS_FLAG,'N') = 'Y' OR ISNULL(IBS_SUPPLEMENTAL_FLAG,'N') ='Y') ) PE INNER JOIN SGT_PERSON_ACCOUNT PA ON PE.PERSON_ACCOUNT_ID = PA.PERSON_ACCOUNT_ID INNER JOIN SGT_PERSON P ON PA.PERSON_ID = P.PERSON_ID INNER JOIN SGS_CODE_VALUE CV ON PA.PLAN_PARTICIPATION_STATUS_ID = CV.CODE_ID AND PA.PLAN_PARTICIPATION_STATUS_VALUE = CV.CODE_VALUE INNER JOIN SGT_PLAN PL ON PA.PLAN_ID = PL.PLAN_ID LEFT OUTER JOIN ( select A.* from SGT_REMITTANCE a inner join SGT_DEPOSIT b on a.DEPOSIT_ID = b.DEPOSIT_ID WHERE B.STATUS_VALUE = 'APLD' AND B.ORG_ID =2428 AND MONTH(APPLIED_DATE) = MONTH(@PAYMENTDATE) AND YEAR(APPLIED_DATE) = YEAR(@PAYMENTDATE)
) AS REM ON PA.PERSON_ID = REM.PERSON_ID --AND PA.PLAN_ID = REM.PLAN_ID
WHERE REM.REMITTANCE_ID IS NULL AND PA.PLAN_PARTICIPATION_STATUS_VALUE = 'ENL2' and PL.BENEFIT_TYPE_VALUE = 'INSR'
UNION ALL
SELECT PA.PERSON_ID, PA.PERSON_ACCOUNT_ID, P.LAST_NAME, P.FIRST_NAME, PL.PLAN_NAME, CV.[DESCRIPTION] AS PLAN_PARTICIPATION_STATUS, 'Remittance exists from TFFR ' + CASE WHEN PE.PERSON_ACCOUNT_ID IS NULL OR ( ISNULL(PE.IBS_FLAG,'N') = 'N' AND ISNULL(PE.IBS_SUPPLEMENTAL_FLAG,'N') ='N' ) THEN 'for a non-IBS member' WHEN ISNULL(PE.PAYMENT_METHOD_VALUE,'') <> 'TFPC' THEN 'but payment election is not TFFR Check' WHEN pa.PERSON_ACCOUNT_ID is null or pa.PLAN_PARTICIPATION_STATUS_VALUE <> 'ENL2' THEN 'but member is not enrolled in plan' Else '' END as ERR_MSG from ( select A.* from SGT_REMITTANCE a inner join SGT_DEPOSIT b on a.DEPOSIT_ID = b.DEPOSIT_ID WHERE B.STATUS_VALUE = 'APLD' AND B.ORG_ID =2428 AND MONTH(APPLIED_DATE) = MONTH(@PAYMENTDATE) AND YEAR(APPLIED_DATE) = YEAR(@PAYMENTDATE)
) AS REM INNER JOIN SGT_PERSON p ON REM.PERSON_ID = P.PERSON_ID LEFT OUTER JOIN SGT_PERSON_ACCOUNT pa ON REM.PERSON_ID = PA.PERSON_ID --AND rem.PLAN_ID = PA.PLAN_ID INNER JOIN SGS_CODE_VALUE CV ON PA.PLAN_PARTICIPATION_STATUS_ID = CV.CODE_ID AND PA.PLAN_PARTICIPATION_STATUS_VALUE = CV.CODE_VALUE INNER JOIN SGT_PLAN PL ON PA.PLAN_ID = PL.PLAN_ID LEFT OUTER JOIN SGT_PERSON_ACCOUNT_PAYMENT_ELECTION PE ON PA.PERSON_ACCOUNT_ID = PE.PERSON_ACCOUNT_ID WHERE ( PE.PERSON_ACCOUNT_ID IS NULL OR ( ISNULL(PE.IBS_FLAG,'N') = 'N' AND ISNULL(PE.IBS_SUPPLEMENTAL_FLAG,'N') ='N' ) OR ISNULL(PE.PAYMENT_METHOD_VALUE,'') <> 'TFPC' OR PA.PERSON_ACCOUNT_ID IS NULL OR PA.PLAN_PARTICIPATION_STATUS_VALUE <> 'ENL2' ) and PL.BENEFIT_TYPE_VALUE = 'INSR'
